import { defineStore } from 'pinia';
import axios from 'axios'; // axios import 추가

export const useDataStore = defineStore('dataStore', {
  state: () => ({
    count: 0,
    nextWorkitems: [] // 추가
  }),
  actions: {
    increment() {
      this.count++;
      console.log(this.count);
    },
    decrement() {
      this.count--;
      console.log(this.count);
    },
    nextWorkItems(nextItem) { // nextWorkItems 함수 이름 수정
      this.nextWorkitems = nextItem;
    }
  }
});
